let checkDomains = async () => {
  try {
    let contactPaths = [
      '',
      '/contact',
      '/contact-us'
    ];

    let domains = [];

    while(dataJson.length > 0) {
      let newField = dataJson.pop();
      let splitHref  = newField.Field1.split(' ')[1].split('%2F');
      let url = splitHref[splitHref.length - 2];
      domains.push(url);
    }
    let cleanDomains = [];
    while(domains.length > 0) {
      let url = domains.pop();
      let check = 0;
      let found = false;
      while(!found && check < 3) {
        let res = await axios.post('https://tech-lookup.herokuapp.com/domainEmail', {
          "url": `${url}${contactPaths[check]}`
        });
        if (!res.data.result == []) {
          cleanDomains.push({
            "url": url,
            "email": res.data.result
          });
          console.log({
            "url": url,
            "email": res.data.result
          });
          found = true;
        }
        check++;
      }
    }
  } catch (e) {
    console.log(e);
    return e;
  }
};

checkDomains();
